INSERT INTO `Item` VALUES (1,'Dow, Oil Prices Fall on New Covid-19 Curbs','U.S. share benchmarks and oil prices declined as investors worried that a rise in Omicron Covid-19 cases would stall economic growth and add pressure to inflation.','2021-12-20 17:17:00','https://www.wsj.com/articles/global-stock-markets-dow-update-12-20-2021-11639989846?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998),(2,'Turkey\'s Borrowing Costs Soar as Crisis Enters New Phase','The lira’s dizzying fall is amplifying concerns among investors and economists that Turkey’s heavily dollarized financial system could be headed for a banking crisis. The currency has lost more than half its value this year, wiping out much of Turks’ savings and triggering sporadic protests.','2021-12-20 16:28:00','https://www.wsj.com/articles/turkeys-borrowing-costs-soar-as-crisis-enters-new-phase-11640015497?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998),(3,'Oracle Tests Investors\' Newfound Faith','The record acquisition of Cerner comes as Oracle’s cloud business has reignited growth and re-energized investors.','2021-12-20 13:24:00','https://www.wsj.com/articles/oracle-tests-investors-newfound-faith-11640024679?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998),(4,'Buy Now, Pay Later Is Just One Piece of the Fintech Puzzle','A regulatory inquiry into split payments sparked a market reaction, but investors will need to think about these services in a wider context.','2021-12-20 12:44:00','https://www.wsj.com/articles/buy-now-pay-later-is-just-one-piece-of-the-fintech-puzzle-11640022287?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998),(5,'Oracle\'s Larry Ellison Targets Health Cloud With $28.3 Billion Bid for Cerner','The U.S. software company calls Cerner an “anchor asset” for its healthcare ambitions.','2021-12-20 12:17:00','https://www.wsj.com/articles/oracle-to-pay-more-than-30-billion-for-cerner-11640006531?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998),(6,'Republican SEC Commissioner Roisman to Leave Agency','Elad Roisman increasingly opposed the SEC chairman’s policy moves, including recent measures proposing changes to money-market mutual funds, corporations’ stock buybacks, and derivatives that are used by hedge funds and some other investors.','2021-12-20 11:33:00','https://www.wsj.com/articles/republican-sec-commissioner-roisman-to-leave-agency-11640012401?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998),(7,'Travel Technology Firm Mondee Inks $1 Billion SPAC Deal to Go Public','The company joins several other travel brands in unveiling SPAC deals during the coronavirus pandemic.','2021-12-20 09:59:00','https://www.wsj.com/articles/travel-technology-firm-mondee-nears-1-billion-spac-deal-to-go-public-11639951201?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998),(8,'Nuclear Power Has a Second Chance to Prove Itself','Governments are reconsidering nuclear power, given its ability to provide predictable carbon-free energy. Fission, splitting atoms to release energy, was the wunderkind of the 1960s and 1970s, but fell from favor after disasters at Three Mile Island, Chernobyl and Fukushima.','2021-12-20 09:48:00','https://www.wsj.com/articles/nuclear-power-has-a-second-chance-to-prove-itself-11640011729?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998),(9,'Chinese EVs Want to Shock Global Markets Next','Despite being the world’s largest auto market, China has never been a big car exporter globally. It seeks to change that in a more-electrified future.','2021-12-20 09:25:00','https://www.wsj.com/articles/chinese-evs-want-to-shock-global-markets-next-11639998183?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998),(10,'Pandemic Trades Roar Back: What to Watch in the Stock Market Today','Vaccine makers and Zoom Video are up premarket; Travel stocks and energy producers are taking a hit.','2021-12-20 09:13:00','https://www.wsj.com/articles/pandemic-trades-roar-back-what-to-watch-when-the-stock-market-opens-today-11640001941?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998),(11,'Bank of Montreal to Buy BNP Paribas\'s U.S. Unit','BNP Paribas said it has agreed to sell Bank of the West to Bank of Montreal for $16.3 billion, in one of the largest recent bank deals.','2021-12-20 07:19:00','https://www.wsj.com/articles/bank-of-montreal-is-in-advanced-talks-to-buy-bnp-paribass-u-s-unit-11639967503?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998),(12,'Bitcoin\'s \'One Percent\' Controls Crypto Wealth','New research shows that just 0.01% of bitcoin holders controls 27% of the currency in circulation.','2021-12-20 05:30:00','https://www.wsj.com/articles/bitcoins-one-percent-controls-lions-share-of-the-cryptocurrencys-wealth-11639996204?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998),(13,'Is the Fed Deflating Prospects for Speculative Stocks?','Speculative stocks have been crushed, even when the wider market reached new highs. Many blame the Federal Reserve, but the link between monetary policy and speculation is less clear than it seems.','2021-12-20 05:17:00','https://www.wsj.com/articles/is-the-fed-deflating-prospects-for-speculative-stocks-11639995463?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998),(14,'Chinese Developer Kaisa Follows Evergrande Into Restructuring Talks','Kaisa said it had failed to make several payments on dollar bonds as planned, and is talking to creditors about a wide-ranging restructuring plan.','2021-12-20 00:27:00','https://www.wsj.com/articles/chinese-developer-kaisa-follows-evergrande-into-restructuring-talks-11639978021?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998),(15,'SenseTime Revives IPO After U.S. Investment Blacklist Forced Delay','Chinese AI giant SenseTime filed revised documents for a Hong Kong IPO and said it still plans to list before the end of the year, after the U.S. government moved to restrict American investors from buying its stock.','2021-12-19 22:20:00','https://www.wsj.com/articles/sensetime-revives-ipo-days-after-u-s-investment-blacklist-forced-delay-11639968854?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998),(16,'Inflation Adds to Cost of Clean Energy Transition','Energy companies have to spend more to build solar and wind farms for the first time in years because of cost inflation and supply-chain problems, adding a financial speed bump to the switch from fossil fuels.','2021-12-19 08:00:00','https://www.wsj.com/articles/inflation-adds-to-cost-of-clean-energy-transition-11639918803?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998),(17,'Equifax to Add More \'Buy Now, Pay Later\' Plans to Credit Reports','The short-term payment plans for small-ticket items are growing quickly, creating a blind spot for lenders.','2021-12-19 07:00:00','https://www.wsj.com/articles/equifax-to-add-more-buy-now-pay-later-plans-to-credit-reports-11639915203?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998),(18,'Sky-High Lumber Prices Are Back','Lumber prices have shot up in a rise reminiscent of a year ago, when high wood prices warned of supply problems and broad inflation to come.','2021-12-19 05:33:00','https://www.wsj.com/articles/sky-high-lumber-prices-are-back-11639842879?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998),(19,'U.S. Gas Exports Likely More Trickle Than Flood','Market conditions look ripe for another wave of liquefied natural gas export terminals being built in the U.S. Grabbing that opportunity will be easier said than done.','2021-12-18 10:00:00','https://www.wsj.com/articles/u-s-gas-exports-likely-more-trickle-than-flood-11639839604?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998),(20,'Investors Balk at Plan to Buy Coal Mines and Close Them','Citigroup and its partners shelved an investment fund they said would put an end date on thermal-coal mines to lower carbon emissions.','2021-12-18 07:13:00','https://www.wsj.com/articles/investors-balk-at-plan-to-buy-coal-mines-and-close-them-11639829583?mod=rss_markets_main','2021-12-21 01:59:42',-99998,'2021-12-21 01:59:42',-99998);
